@Pika das Galáxias A resposta de um leigo seriam "os políticos malvados", visto ser o que veem diante de seus olhos. 
A resposta verdadeira, os bilionários financiam os políticos, depois inserem ainda mais dinheiro para os mesmos defenderem apenas às suas pautas, sejam o que sejam. 
Os políticos são corruptos? São, claro que são, mas não podemos deixar de frisar seu papel de marionetes compradas e treinadas para essa função, o comandante em chefe do jogo é a  elite do dinheiro.

